var app=angular.module("ourApp",[]);app.controller("mainController",["$scope","$http",function(a,b){a.student_name="",a.date_completed=new Date,a.assignment_number=1,a.score=100,a.assignmentsList={},a.addAssignment=function(){var c={};c.student_name=a.student_name,c.date_completed=a.date_completed,c.assignment_number=a.assignment_number,c.score=a.score,b.post("/newAssignment",c).then(function(a){console.log()})},setInterval(function(){b.get("/assignment").then(function(b){b.data!=a.assignmentsList&&(a.assignmentsList=b.data,console.log(a.assignmentsList))})},5e3)}]);